import "./App.css";

/* 1. На входе статичный массив чисел. Отобразить на странице только чётные числа, каждое в
теге <li>. */

function App() {
  const arr = [1, 2, 3, 4, 5];
  const res1 = arr.filter((el) => el % 2 === 0);
  const res2 = res1.map((el) => <li>{el}</li>);
  return <div>
    res2}
  </div>;
}

export default App;
